package p1;

public class Relational_oper {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10,b=20;
		System.out.println("relational operator");
		System.out.println((a<b));
		System.out.println((a>b));
		System.out.println((a==b));
		
		System.out.println((a<=b));
		System.out.println((a>=b));
		System.out.println((a!=b));
		
	}

}
